        "#Regression Scatter Plot Between Temperature and Total of Bikers in 2011\n",
        "#Data in 2011\n",
        "sns.regplot(\n",
        "    y=year_2011[\"cnt\"],\n",
        "    x=year_2011[\"temp\"]\n",
        ")\n",
        "plt.title(\"Scatter Plot of Temperature and Total of Bikers in 2011\", loc=\"center\", fontsize=15)\n",
