        "    y=year_2012[\"cnt\"],\n",
        "    x=year_2012[\"temp\"]\n",
        ")\n",
        "plt.title(\"Regression Scatter Plot of Temperature and Total of Bikers in 2012\", loc=\"center\", fontsize=15)\n",
        "plt.show()\n",
